import React from "react";
import "../../Assets/Fonts/LemonMilkRegularFont.css";

const Navbar: React.FC = () => {
    return <div className="container-fluid">
        <div style={{marginTop: "10px", marginBottom: "50px"}} className="border-bottom border-warning border-2">
            <nav className="nav d-flex justify-content-between">
                <button className="lemonmilkregular-font-medium">About Me</button>
                <button className="lemonmilkregular-font-medium">My Projects</button>
                <button className="lemonmilkregular-font-medium">Freelancing</button>
                <button className="lemonmilkregular-font-medium">Contact Me</button>
            </nav>
        </div>
    </div>
}

export default Navbar;
